import React from 'react';
import { NavLink } from 'react-router-dom';

class Logo extends React.Component {

    render() {
        return (
            <NavLink to='/'>
                <div className="ui items">
                    <div className="item" style={{padding: "0x 0px 0px 0px"}}>
                        <div className="ui mini image">
                            <img alt="logo" src="favicon.ico"/>
                        </div>
                        <div className="middle aligned content" style={{padding: "13px 0px 0px 0px"}}>
                            <p className="header">Youtube TV</p>
                        </div>
                    </div>
                </div>
            </NavLink>
        );
    }
}

export default Logo;
